    $name = $matches[1];

    print tab([
        $mid,
        $stock,
        '$' . number_format($price, 2),
        $name
    ]);
    print "\n";
}

print "I am done!\n";

function tab(array $elements): string
{
    $output = '';
    foreach ($elements as $element) {
        $output .= str_pad($element, 20, " ", STR_PAD_RIGHT);
    }
    return $output;
}

